import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import ProductCard from './components/ProductCard';
import CartPage from './components/CartPage';
import './App.css';  // Подключаем основной файл стилей

const App = () => {
    const products = [
        { id: 1, name: 'Product 1', price: 100, image: 'https://via.placeholder.com/150' },
        { id: 2, name: 'Product 2', price: 200, image: 'https://via.placeholder.com/150' },
        { id: 3, name: 'Product 3', price: 300, image: 'https://via.placeholder.com/150' },
    ];

    return (
        <Router>
            <Navbar />
            <Routes>
                <Route path="/" element={
                    <div className="main-content">
                        <div className="product-list">
                            {products.map(product => (
                                <ProductCard key={product.id} product={product} />
                            ))}
                        </div>

                        <section className="about-us">
                            <h2>О нас</h2>
                            <p>Мы продаем качественную бытовую технику с доставкой по всему региону.</p>
                        </section>

                        <section className="contact">
                            <h2>Контакты</h2>
                            <form>
                                <label htmlFor="name">Имя:</label>
                                <input type="text" id="name" name="name" />
                                <label htmlFor="email">Email:</label>
                                <input type="email" id="email" name="email" />
                                <label htmlFor="message">Сообщение:</label>
                                <textarea id="message" name="message"></textarea>
                                <button type="submit">Отправить</button>
                            </form>
                        </section>

                        <section className="map">
                            <h2>Наша карта</h2>
                            <iframe 
                                src="https://www.google.com/maps/embed?pb=...your_map_link..."
                                width="600" 
                                height="450" 
                                allowFullScreen="" 
                                loading="lazy" 
                                referrerpolicy="no-referrer-when-downgrade">
                            </iframe>
                        </section>
                    </div>
                } />
                <Route path="/cart" element={<CartPage />} />
            </Routes>
        </Router>
    );
};

export default App;
